def doprediction(model, thisimg, target_size=(400, 400), top_n=5):
    x = image.img_to_array(thisimg)
    x = np.expand_dims(x, axis=0)
    x = preprocess_input(x)
    preds = model.predict(x)
    return decode_predictions(preds, top=top_n)[0]

